import React from 'react';
import images from '../../constants/images';
import './Navbar.scss';

const Navbar = () => {
  return (
    <nav>
      <div>
        <img src={images.logo} alt="logo" width="1.9%" height="1.9%" />
      </div>
      <ul>
        {['home', 'about', 'contact', 'work', 'skills', 'contact'].map((item) => (
            <li key={`link-${item}`} >
              <div />
              <a href={`#${item}`} ></a>
            </li>
        ))}
      </ul>
    </nav>
  );
}

export default Navbar;
